%% ##################################################
%% BIAS CONSTRAINTS
%% ##################################################
%% DATALOG
:-
    not non_datalog,
    non_datalog(Rule).
    %% head_var(C,Var),
    %% not body_var(C,Var).

non_datalog(Rule):-
    head_var(Rule,Var),
    not body_var(Rule,Var).


%% ELIMINATE SINGLETONS
:-
    not allow_singletons,
    %% singleton(_,_).
    clause_var(C,Var),
    #count{P,Vars : var_in_literal(C,P,Vars,Var)} == 1.

var_appears_more_than_twice(Rule,Var):-
    not allow_singletons,
    clause_var(Rule,Var),
    #count{P,Vars : var_in_literal(Rule,P,Vars,Var)} > 2.

%% MUST BE CONNECTED
head_connected(C,Var):-
    head_var(C,Var).
head_connected(C,Var1):-
    head_literal(C,_,A,_),
    Var1 >= A,
    head_connected(C,Var2),
    body_literal(C,_,_,Vars),
    var_member(Var1,Vars),
    var_member(Var2,Vars),
    Var1 != Var2.
:-
    head_literal(C,_,A,_),
    Var >= A,
    body_var(C,Var),
    not head_connected(C,Var).


