%% ##################################################
%% SUBSUMPTION
%% ##################################################
same_head(C1,C2):-
    C1 > 0,
    C1 < C2,
    head_literal(C1,P,A,Vars),
    head_literal(C2,P,A,Vars).

not_body_subset(C1,C2):-
    C1 > 0,
    clause(C2),
    C1 < C2,
    body_literal(C1,P,A,Vars),
    not body_literal(C2,P,A,Vars).

body_subset(C1,C2):-
    C1 > 0,
    clause(C2),
    C1 < C2,
    not not_body_subset(C1,C2),
    body_literal(C1,P,A,Vars),
    body_literal(C2,P,A,Vars).
:-
    C1 > 0,
    C1 < C2,
    same_head(C1,C2),
    body_subset(C1,C2).

